def build_cstbuilder(cstbuilder):
    and_expr         = cstbuilder.builder(831055, 'and_expr', "and_expr: shift_expr ('&' shift_expr)*")
    and_test         = cstbuilder.builder(831049, 'and_test', "and_test: not_test ('and' not_test)*")
    arglist          = cstbuilder.builder(831073, 'arglist', "arglist: ( argument ',')* ( argument [','] | '*' test [',' '**' test] | '**' test)")
    argument         = cstbuilder.builder(831074, 'argument', "argument: test [gen_for] | test '=' test")
    arith_expr       = cstbuilder.builder(831057, 'arith_expr', "arith_expr: term (('+' | '-') term)*")
    as_name          = cstbuilder.builder(831084, 'as_name', "as_name: 'as' NAME")
    assert_stmt      = cstbuilder.builder(831034, 'assert_stmt', "assert_stmt: 'assert' test [',' test]")
    atom             = cstbuilder.builder(831061, 'atom', "atom: ('(' [yield_expr | testlist_gexp] ')' | '[' [listmaker] ']' | '{' [dictmaker] '}' | '`' testlist1 '`' | NAME | NUMBER | STRING+) | IPv4Address")
    augassign        = cstbuilder.builder(831014, 'augassign', "augassign: ('+=' | '-=' | '*=' | '/=' | '%=' | '&=' | '|=' | '^=' | '<<=' | '>>=' | '**=' | '//=')")
    break_stmt       = cstbuilder.builder(831019, 'break_stmt', "break_stmt: 'break'")
    case_stmt        = cstbuilder.builder(831087, 'case_stmt', "case_stmt: 'case' expr ':' suite ('case' expr ':' suite)*")
    classdef         = cstbuilder.builder(831072, 'classdef', "classdef: 'class' NAME ['(' [testlist] ')'] ':' suite")
    comp_op          = cstbuilder.builder(831052, 'comp_op', "comp_op: '<' | '>' | '==' | '>=' | '<=' | '<>' | '!=' | 'in' | 'not' 'in' | 'is' | 'is' 'not'")
    comparison       = cstbuilder.builder(831051, 'comparison', "comparison: expr ( comp_op expr)*")
    compound_stmt    = cstbuilder.builder(831035, 'compound_stmt', "compound_stmt: if_stmt | while_stmt | for_stmt | try_stmt | with_stmt | funcdef | classdef | repeat_stmt | switch_stmt | thunk_stmt")
    continue_stmt    = cstbuilder.builder(831020, 'continue_stmt', "continue_stmt: 'continue'")
    decorator        = cstbuilder.builder(831003, 'decorator', "decorator: '@' dotted_name ['(' [arglist] ')'] NEWLINE")
    decorators       = cstbuilder.builder(831004, 'decorators', "decorators: decorator+")
    del_stmt         = cstbuilder.builder(831016, 'del_stmt', "del_stmt: 'del' exprlist")
    dictmaker        = cstbuilder.builder(831071, 'dictmaker', "dictmaker: test ':' test (',' test ':' test)* [',']")
    dotted_as_name   = cstbuilder.builder(831028, 'dotted_as_name', "dotted_as_name: dotted_name [('as' | NAME) NAME]")
    dotted_as_names  = cstbuilder.builder(831030, 'dotted_as_names', "dotted_as_names: dotted_as_name (',' dotted_as_name)*")
    dotted_name      = cstbuilder.builder(831031, 'dotted_name', "dotted_name: NAME ('.' NAME)*")
    encoding_decl    = cstbuilder.builder(831082, 'encoding_decl', "encoding_decl: NAME")
    eval_input       = cstbuilder.builder(831002, 'eval_input', "eval_input: testlist NEWLINE* ENDMARKER")
    except_clause    = cstbuilder.builder(831042, 'except_clause', "except_clause: 'except' [test [',' test]]")
    exec_stmt        = cstbuilder.builder(831033, 'exec_stmt', "exec_stmt: 'exec' expr ['in' test [',' test]]")
    expr             = cstbuilder.builder(831053, 'expr', "expr: xor_expr ('|' xor_expr)*")
    expr_stmt        = cstbuilder.builder(831013, 'expr_stmt', "expr_stmt: testlist ( augassign ( yield_expr | testlist) | ('=' ( yield_expr | testlist))*)")
    exprlist         = cstbuilder.builder(831069, 'exprlist', "exprlist: expr (',' expr)* [',']")
    factor           = cstbuilder.builder(831059, 'factor', "factor: ('+' | '-' | '~') factor | power")
    file_input       = cstbuilder.builder(831001, 'file_input', "file_input: ( NEWLINE | stmt)* ENDMARKER")
    flow_stmt        = cstbuilder.builder(831018, 'flow_stmt', "flow_stmt: break_stmt | continue_stmt | return_stmt | raise_stmt | yield_stmt")
    for_stmt         = cstbuilder.builder(831038, 'for_stmt', "for_stmt: 'for' exprlist 'in' testlist ':' suite ['else' ':' suite]")
    fpdef            = cstbuilder.builder(831008, 'fpdef', "fpdef: NAME | '(' fplist ')'")
    fplist           = cstbuilder.builder(831009, 'fplist', "fplist: fpdef (',' fpdef)* [',']")
    funcdef          = cstbuilder.builder(831005, 'funcdef', "funcdef: [decorators] 'def' NAME parameters ':' suite")
    gen_for          = cstbuilder.builder(831079, 'gen_for', "gen_for: 'for' exprlist 'in' or_test [gen_iter]")
    gen_if           = cstbuilder.builder(831080, 'gen_if', "gen_if: 'if' old_test [gen_iter]")
    gen_iter         = cstbuilder.builder(831078, 'gen_iter', "gen_iter: gen_for | gen_if")
    global_stmt      = cstbuilder.builder(831032, 'global_stmt', "global_stmt: 'global' NAME (',' NAME)*")
    if_stmt          = cstbuilder.builder(831036, 'if_stmt', "if_stmt: 'if' test [as_name] ':' suite ('elif' test [as_name] ':' suite)* ['else' ':' suite]")
    import_as_name   = cstbuilder.builder(831027, 'import_as_name', "import_as_name: NAME [('as' | NAME) NAME]")
    import_as_names  = cstbuilder.builder(831029, 'import_as_names', "import_as_names: import_as_name (',' import_as_name)* [',']")
    import_from      = cstbuilder.builder(831026, 'import_from', "import_from: ('from' ('.'* dotted_name | '.'+) 'import' ('*' | '(' import_as_names ')' | import_as_names))")
    import_name      = cstbuilder.builder(831025, 'import_name', "import_name: 'import' dotted_as_names")
    import_stmt      = cstbuilder.builder(831024, 'import_stmt', "import_stmt: import_name | import_from")
    lambdef          = cstbuilder.builder(831064, 'lambdef', "lambdef: 'lambda' [varargslist] ':' test")
    list_for         = cstbuilder.builder(831076, 'list_for', "list_for: 'for' exprlist 'in' testlist_safe [list_iter]")
    list_if          = cstbuilder.builder(831077, 'list_if', "list_if: 'if' old_test [list_iter]")
    list_iter        = cstbuilder.builder(831075, 'list_iter', "list_iter: list_for | list_if")
    listmaker        = cstbuilder.builder(831062, 'listmaker', "listmaker: test ( list_for | (',' test)* [','])")
    not_test         = cstbuilder.builder(831050, 'not_test', "not_test: 'not' not_test | comparison")
    old_lambdef      = cstbuilder.builder(831046, 'old_lambdef', "old_lambdef: 'lambda' [varargslist] ':' old_test")
    old_test         = cstbuilder.builder(831045, 'old_test', "old_test: or_test | old_lambdef")
    or_test          = cstbuilder.builder(831048, 'or_test', "or_test: and_test ('or' and_test)*")
    parameters       = cstbuilder.builder(831006, 'parameters', "parameters: '(' [varargslist] ')'")
    pass_stmt        = cstbuilder.builder(831017, 'pass_stmt', "pass_stmt: 'pass'")
    power            = cstbuilder.builder(831060, 'power', "power: atom trailer* ['**' factor]")
    print_stmt       = cstbuilder.builder(831015, 'print_stmt', "print_stmt: 'print' ([test (',' test)* [',']] | '>>' test [(',' test)+ [',']])")
    raise_stmt       = cstbuilder.builder(831023, 'raise_stmt', "raise_stmt: 'raise' [test [',' test [',' test]]]")
    repeat_stmt      = cstbuilder.builder(831085, 'repeat_stmt', "repeat_stmt: 'repeat' ':' suite 'until' ':' ( NEWLINE INDENT test NEWLINE DEDENT | test NEWLINE)")
    return_stmt      = cstbuilder.builder(831021, 'return_stmt', "return_stmt: 'return' [testlist]")
    shift_expr       = cstbuilder.builder(831056, 'shift_expr', "shift_expr: arith_expr (('<<' | '>>') arith_expr)*")
    simple_stmt      = cstbuilder.builder(831011, 'simple_stmt', "simple_stmt: small_stmt (';' small_stmt)* [';'] NEWLINE")
    single_input     = cstbuilder.builder(831000, 'single_input', "single_input: NEWLINE | simple_stmt | compound_stmt NEWLINE")
    sliceop          = cstbuilder.builder(831068, 'sliceop', "sliceop: ':' [test]")
    small_stmt       = cstbuilder.builder(831012, 'small_stmt', "small_stmt: expr_stmt | print_stmt | del_stmt | pass_stmt | flow_stmt | import_stmt | global_stmt | exec_stmt | assert_stmt")
    stmt             = cstbuilder.builder(831010, 'stmt', "stmt: simple_stmt | compound_stmt")
    subscript        = cstbuilder.builder(831067, 'subscript', "subscript: '.' '.' '.' | test | [test] ':' [test] [sliceop]")
    subscriptlist    = cstbuilder.builder(831066, 'subscriptlist', "subscriptlist: subscript (',' subscript)* [',']")
    suite            = cstbuilder.builder(831043, 'suite', "suite: simple_stmt | NEWLINE INDENT stmt+ DEDENT")
    switch_stmt      = cstbuilder.builder(831086, 'switch_stmt', "switch_stmt: 'switch' expr ':' NEWLINE INDENT case_stmt DEDENT ['else' ':' suite]")
    term             = cstbuilder.builder(831058, 'term', "term: factor (('*' | '/' | '%' | '//') factor)*")
    test             = cstbuilder.builder(831047, 'test', "test: or_test ['if' or_test 'else' test] | lambdef")
    testlist         = cstbuilder.builder(831070, 'testlist', "testlist: test (',' test)* [',']")
    testlist1        = cstbuilder.builder(831081, 'testlist1', "testlist1: test (',' test)*")
    testlist_gexp    = cstbuilder.builder(831063, 'testlist_gexp', "testlist_gexp: test ( gen_for | (',' test)* [','])")
    testlist_safe    = cstbuilder.builder(831044, 'testlist_safe', "testlist_safe: old_test [(',' old_test)+ [',']]")
    thunk_stmt       = cstbuilder.builder(831088, 'thunk_stmt', "thunk_stmt: small_stmt ':' suite")
    trailer          = cstbuilder.builder(831065, 'trailer', "trailer: '(' [arglist] ')' | '[' subscriptlist ']' | '.' NAME")
    try_stmt         = cstbuilder.builder(831039, 'try_stmt', "try_stmt: ('try' ':' suite (( except_clause ':' suite)+ ['else' ':' suite] ['finally' ':' suite] | 'finally' ':' suite))")
    varargslist      = cstbuilder.builder(831007, 'varargslist', "varargslist: (( fpdef ['=' test] ',')* ('*' NAME [',' '**' NAME] | '**' NAME) | fpdef ['=' test] (',' fpdef ['=' test])* [','])")
    while_stmt       = cstbuilder.builder(831037, 'while_stmt', "while_stmt: 'while' test ':' suite ['else' ':' suite]")
    with_stmt        = cstbuilder.builder(831040, 'with_stmt', "with_stmt: 'with' test [with_var] ':' suite")
    with_var         = cstbuilder.builder(831041, 'with_var', "with_var: ('as' | NAME) expr")
    xor_expr         = cstbuilder.builder(831054, 'xor_expr', "xor_expr: and_expr ('^' and_expr)*")
    yield_expr       = cstbuilder.builder(831083, 'yield_expr', "yield_expr: 'yield' [testlist]")
    yield_stmt       = cstbuilder.builder(831022, 'yield_stmt', "yield_stmt: yield_expr")
    return locals()

